	NewOperationCmd(gen_PersistentStoreIntegrationsBetaResourceCmd, client, markdownRenderer, OperationData{
		Short: "Create big segment store integration",
		Long:  "\nCreate a persistent store integration.\n\nIf you are using server-side SDKs, segments synced from external tools and larger list-based segments require a persistent store within your infrastructure. LaunchDarkly keeps the persistent store up to date and consults it during flag evaluation.\n\nYou can use either Redis or DynamoDB as your persistent store. When you create a persistent store integration, the fields in the `config` object in the request vary depending on which persistent store you use.\n\nIf you are using Redis to create your persistent store integration, you will need to know:\n\n* Your Redis host\n* Your Redis port\n* Your Redis username\n* Your Redis password\n* Whether or not LaunchDarkly should connect using TLS\n\nIf you are using DynamoDB to create your persistent store integration, you will need to know:\n\n* Your DynamoDB table name. The table must have the following schema:\n  * Partition key: `namespace` (string)\n  * Sort key: `key` (string)\n* Your DynamoDB Amazon Web Services (AWS) region.\n* Your AWS role Amazon Resource Name (ARN). This is the role that LaunchDarkly will assume to manage your DynamoDB table.\n* The External ID you specified when creating your Amazon Resource Name (ARN).\n\nTo learn more, read [Segment configuration](https://launchdarkly.com/docs/home/flags/segment-config).\n",
		Use:   "create-big-segment-store-integration",
		Params: []Param{
			{
				Name:        "project-key",
				In:          "path",
				Description: "The project key",
				Type:        "string",
			},
			{
				Name:        "environment-key",
				In:          "path",
				Description: "The environment key",
				Type:        "string",
			},
			{
				Name:        "integration-key",
				In:          "path",
				Description: "The integration key, either 'redis' or 'dynamodb'",
				Type:        "string",
			},
		},
		HTTPMethod:            "POST",
		HasBody:               true,
		IsBeta:                true,
		RequiresBody:          true,
		Path:                  "/api/v2/integration-capabilities/big-segment-store/{projectKey}/{environmentKey}/{integrationKey}",
		SupportsSemanticPatch: false,
	})

